import React /*{ useState }*/ from 'react';

import { /*TextField, Stack,*/ Paper, /*Grid, Input, Button*/ } from '@mui/material';
import Box from '@mui'
import { DataGrid } from '@mui/x-data-grid';

const MHPPage = () => {
  let bgcolor = '#' + '80A1D4'
  let background = {backgroundColor: bgcolor}
  // let underline = {textDecoration: 'underline'}
  // let [isEditing, setIsEditing] = useState(false);

  // const submit = () => {
  //   console.log('submit')
  //   setIsEditing(!isEditing)
  // }

  const columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    { field: 'firstName', headerName: 'First name', width: 130 },
    { field: 'lastName', headerName: 'Last name', width: 130 },
  ]

  const rows = [
    { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
    { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
    { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
    { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
  ]

  return (
    <>
      <Paper elevation={3} sx={{height: 400, width: '50%', marginLeft: '25%', marginRight: '25%', paddingBottom: '2vw', marginBottom: '5vw', borderRadius: '6px'}}>
        <h1 style={{textAlign: 'center', ...background, borderRadius: '6px'}}>Mental Health Provider</h1>
        <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[2]}
        checkboxSelection
        />

          {/* {isEditing ? 
          <>

            <Button onClick={() => submit()}>Submit</Button><Button onClick={() => setIsEditing(!isEditing)}>Cancel</Button>
          </>
          :
          <>

            <Button onClick={() => setIsEditing(!isEditing)}>Edit</Button>
          </>
          }
         */}
      </Paper>
    </>
  )
}

export default MHPPage;
